import styled from "styled-components"

const MovieContainer = styled.div`
  display: grid;
  grid-template-rows: 50px 1fr 30px 1fr;  
  color: #8A8A8A;

  .title {
    grid-row: 1;
    font-family: 'Gill Sans', 'Gill Sans MT', Calibri, 'Trebuchet MS', sans-serif;
    font-size: 13px;
    font-weight: 300;
  }
`

export { MovieContainer }
